import Box from "../Box";
import './Container.css';
function Container(props){
    const itirations=[1,2,3,4,5];
    return(
        <>
        <div className="container">
            {
                itirations.map((item,index)=>(<Box/> ))
            }  
        </div>
        </>
    )

}
export default Container;
